  EN'>Collecting some resources from my mind to one pages, what I working on is more than just genuine work but public. Im living in Balikpapan, East BorneoIndonesia which my background is born by an Engineers parent working as a Public Electronic Service. In a young age, I almost spend my time to crawling on internet reading articles writing by a several peoplemostly very technical. Im not alone to be that person actually have a bunch of friends such offline even online to sharing same interest. Were know thats not so principle nor academic which I believe in realityacademia is a place for sharping soft skill much better. My experience in working time is more rubbish than I expected theirs so many problemnot in just on rules, but our limitation to actits make my career not in a true path changing work every time just for a lively goodarranged so unlikely through my application apparently. In many times on that matter Im trying to move forward and here Im writing my historical heritagespending day-after-day to represent output as a learner. Globalization make us think differently of course its because future technologies after 60s spreading computer trends growing rapidly until nowwere instantly to learn, to chat and to livepossibly to forget were coming from, a nature.<o:p></o:p></span></p>
